import { useQuery } from '@apollo/client';
import React from 'react';
import {useState} from 'react';
import '../App.css';
import {getUsers} from "../queries"

function Users() {
	const [users, fetchUsers] = useState("click the button to fetch users");
	const getusers = useQuery(getUsers);
	fetchUsers(getusers);
	return(
		<body>
			<p>
				{users}
			</p>
			<button name="showusers" onClick={() => fetchUsers(getusers)}>
				get users
			</button>
		</body>
	)
}

export default Users;
